BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "grupo" (
	"id"	INTEGER NOT NULL,
	"nombre"	VARCHAR(100),
	UNIQUE("nombre"),
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "receta" (
	"id"	INTEGER NOT NULL,
	"nombre"	VARCHAR(100) NOT NULL,
	"rendimiento"	FLOAT NOT NULL,
	"unidad"	VARCHAR(20) NOT NULL,
	"indicaciones"	TEXT,
	PRIMARY KEY("id"),
	UNIQUE("nombre")
);
CREATE TABLE IF NOT EXISTS "equivalente" (
	"id"	INTEGER NOT NULL,
	"nombre"	VARCHAR(100),
	"grupo_id"	INTEGER NOT NULL,
	FOREIGN KEY("grupo_id") REFERENCES "grupo"("id"),
	PRIMARY KEY("id"),
	UNIQUE("nombre")
);
CREATE TABLE IF NOT EXISTS "propiedades" (
	"id"	INTEGER NOT NULL,
	"equivalente_id"	INTEGER NOT NULL,
	"concepto_id"	INTEGER NOT NULL,
	"valor"	VARCHAR(10) NOT NULL,
	FOREIGN KEY("equivalente_id") REFERENCES "equivalente"("id"),
	PRIMARY KEY("id"),
	FOREIGN KEY("concepto_id") REFERENCES "concepto"("id")
);
CREATE TABLE IF NOT EXISTS "ingrediente" (
	"id"	INTEGER NOT NULL,
	"cantidad"	FLOAT NOT NULL,
	"equivalente_id"	INTEGER,
	"receta_id"	INTEGER,
	FOREIGN KEY("receta_id") REFERENCES "receta"("id"),
	FOREIGN KEY("equivalente_id") REFERENCES "equivalente"("id"),
	PRIMARY KEY("id")
);
COMMIT;
